import React from 'react';
import './First.css';
import img1 from '../../images/one.jpeg';
import img2 from '../../images/two.jpeg';
export default function First(){
     return(
        <>
             <div className="f-wrapper">
                <div className="f1">
                    <img src={img1} alt="" className='f-img' />
                </div>
                <div className="f2">
                    <img src={img2} alt="" className='f-img2' />
                    <div className="f2-text">
                        <div className="f2-heading">Director's Message</div>
                        <div className="f2-text">
                            Lorem ipsum dolor sit amet consectetur adipisicing elit. Tempora laudantium qui voluptatibus. In, fuga odit consequuntur expedita, molestias sint necessitatibus exercitationem vel quam quaerat dolorem illo perferendis soluta, sapiente sit praesentium eum dolorum? Beatae quas voluptates error adipisci harum, nisi, eaque ipsam animi itaque laboriosam, fugiat fuga dolorum. Labore, ratione.
                        </div>
                    </div>
                </div>
             </div>
        </>
     )
}
